import React from "react";

export const Login = (props) => {
  return (
    <form>
    <label>
      <p>Username</p>
      <input type="text" />
    </label>
    <label>
      <p>Password</p>
      <input type="password" />
    </label>
    <div>
      <button type="submit">Submit</button>
    </div>
  </form>
  );
};
